import PropTypes from 'prop-types'

const Header = ({title}) => {
  return (
    <header>
      <h1> {title} </h1>
    </header>
  )}

export default Header

Header.defaultProps = {
    title: 'Task Tracker'
}

Header.propTypes = {
    title: PropTypes.string.isRequired
}

const styles = {
    header: {
        background: '#3353',
        color: '#fff',
        textAlign: 'center',
        padding: '10px'
    }   // end of header
}
